//smooth scroll
    $(".navigate-btn").on("click", function (event) {
        //отменяем стандартную обработку нажатия по ссылке
        event.preventDefault();
        var id = $(this).attr('href'),
            top = $(id).offset().top - 100;
        //анимируем переход на расстояние - top за 1500 мс
        $('body,html').animate({scrollTop: top}, 1500);
    });


//scrollArrow
    $(window).scroll(function () {
        if ($(this).scrollTop() > 80) {
            $('#scrollArrow').fadeOut(500)
        }
        if ($(this).scrollTop() < 80) {
            $('#scrollArrow').fadeIn(500)
        }
    });


    //сделки минислайдер
    function nextMsg(i) {
        if (messages.length == i) {
            i = 0;
        }
        $('#deals').html(messages[i]).fadeIn(500).delay(2500).fadeOut(500, function () {
            nextMsg(i + 1);
        });
    };
    let messages = [
        "Ford Explorer 2018, выдано 1 млн ₽ под 4,5%",
        "Audi A8 2018, выдано 4,5 млн ₽ под 4%",
        "Audi Q7 2011, выдано 750 000 ₽ под 6%"
    ];
    $('#deals').hide();
    nextMsg(0);





    // ф-я разбивки на разряды
    function number_format(str) {
        return str.replace(/(\d{1,3}(?=(\d{3})+(?:\.\d|\b)))/g, "\$1 ");
    }
    // удаляем пробелы из строки
    function number_norm(str) {
        return str.replace(/\s+/g, '');
    }

    // значения по дефоту в скрытых инпутах
    $('input[name="cash_get"]').val($('#total').html());
    $('input[name="payment"]').val($('#month').html());
    $('input[name="pledge"]').val($('.b-block__title').html());

    // ползунок суммы
    $("#cash").slider({
        range: "min",
        value: 100000,
        min: 100000,
        step: 100000,
        max: 10000000,
        slide: function(event, ui) {
            $("#amount_cash").val(ui.value);
            total();
        }
    });


    $("#amount_cash").val(($("#cash").slider("value")));
    $("#amount_cash").val(number_format($("#amount_cash").val()));

    //расчет по дате и сумме
    function total() {
        var totalGet = $('#total'),
            totalPayMonth = $('#month'),
            days = $("#amount_time").val(),
            cash = $("#amount_cash").val();

        totalGet.html($("#amount_cash").val() * 0.9);

        if (days >= 1 && days <= 365) {
            totalPayMonth.html(cash * 0.9 * 0.039);
        } 	
		
		
/*
        if (days >= 1 && days <= 6) {
            totalPayMonth.html(cash * 0.9 * 0.01);
        } else if (days >= 7 && days <= 9) {
            totalPayMonth.html(cash * 0.9 * 0.02);
        } else if (days >= 10 && days <= 13) {
            totalPayMonth.html(cash * 0.9 * 0.03);
        } else if (days >= 14 && days <= 20) {
            totalPayMonth.html(cash * 0.9 * 0.04);
        } else if (days >= 21 && days <= 29) {
            totalPayMonth.html(cash * 0.9 * 0.045);
        } else if (days >= 30 && days <= 365) {
            totalPayMonth.html(cash * 0.9 * 0.039);
        }
*/
        totalGet.html(number_format(totalGet.html()));
        $('input[name="cash_get"]').val(totalGet.html());
        totalPayMonth.html(number_format(totalPayMonth.html()));
        $('input[name="payment"]').val(totalPayMonth.html());
        $("#amount_cash").val(number_format($("#amount_cash").val()));
    }

    //  сопряжение слов
    function getNumEnding(iNumber, aEndings) {
        var sEnding, i;
        iNumber = iNumber % 100;
        if (iNumber >= 11 && iNumber <= 19) {
            sEnding = aEndings[2];
        } else {
            i = iNumber % 10;
            switch (i) {
                case (1):
                    sEnding = aEndings[0];
                    break;
                case (2):
                case (3):
                case (4):
                    sEnding = aEndings[1];
                    break;
                default:
                    sEnding = aEndings[2];
            }
        }
        return sEnding;
    }

    // ползунок даты
    $("#time").slider({
        range: "min",
        value: 1,
        min: 1,
        step: 1,
        max: 36,
        slide: function(event, ui) {
            $("#amount_time").val(ui.value);
            $('.b-calc-param__textday').html(getNumEnding($("#amount_time").val(), ['месяц', 'месяца', 'месяцев']));
            $("#amount_cash").val(number_norm($("#amount_cash").val()));
            total();
        }
    });
    $("#amount_time").val($("#time").slider("value"));


    //отправка формы
    $("#calculator-form").submit(function() {
        let $form = $(this);
        //сюда приписюлить валидацию =)

        var phone = $form.find('input[name=phone]'),
            name = $form.find('input[name=name]'),
            err = false;

        if(!Inputmask.isValid(phone.val(),{alias:"+7 (999) 999-99-99"})){
            phone.attr('style','border-bottom: 3px solid red; background: rgba(255, 0, 0, 0.06);');
            err = true;
        }
        if(name.val()==''){
            name.attr('style','border-bottom: 3px solid red; background: rgba(255, 0, 0, 0.06);');
            err = true;
        }

        if(err)
            return false;

        phone.removeAttr('style');
        name.removeAttr('style');

		$form.find('.send-button').val('');
		$form.find('.send-button').prop("disabled", true);
		$form.find('.send-button').addClass('form-sent');
		$form.find("#total-form").trigger("reset");

		ym(57053437, 'reachGoal', 'yaorder');

		var fd = new FormData;
		for(var i=0,n=this.length;i<n;i++)
			if(this[i].name)
				if(this[i].type=='file'){
					if(this[i].files.length>0)
						fd.append(this[i].name,this[i].files[0]);
				}else
					fd.append(this[i].name,this[i].value);

        $.ajax({
            type: "POST",
            url: "mail.php",
			data: fd,
			processData: false,
			contentType: false,
        }).done(function() {

        }.bind(this));
        return false;
    });

